package com.example.guessfm

import android.util.Log
import com.google.firebase.BuildConfig
import com.google.gson.Gson
import com.google.gson.GsonBuilder
import com.google.gson.JsonElement
import com.google.gson.JsonObject
import okhttp3.HttpUrl
import okhttp3.OkHttpClient
import okhttp3.Request
import kotlin.random.Random


private val API_KEY = com.example.guessfm.BuildConfig.API_KEY

val urlHost = "ws.audioscrobbler.com"
val urlMethod = "user.gettoptracks"
val urlTrackDetails = ""
val aUrl = "https://ws.audioscrobbler.com/2.0/?method=user.gettoptracks"

class Game {
    constructor(username: String, limit: Int?){
        this.username = username
        this.limit = limit?: 50
        pickRandomSong()
        initializeClues()

    }
    val username: String
    val limit: Int
    lateinit var trackId: String
    lateinit var trackName: String
    //data for clues
    lateinit var artistName: String
    lateinit var plays: Number//maybe rank instead
    lateinit var tag: String//maybe multiple tags
    var durationSeconds: Int = 0
    //clues
    var clues: MutableList<String> = mutableListOf<String>()
    var guesses: MutableList<String> = mutableListOf<String>()
    var numGuesses = 0

    fun pickRandomSong(){

        val okClient = OkHttpClient()

        val okRequest = Request.Builder().url(
            HttpUrl.Builder()
                .scheme("https")
                .host(urlHost)
                .addPathSegment("2.0")
                .addQueryParameter("method", urlMethod)
                .addQueryParameter("api_key", API_KEY)
                .addQueryParameter("user", username)
                .addQueryParameter("limit", limit.toString())
                .addQueryParameter("format","json")
                .build()
        )
            .build()
        val okResponse = okClient.newCall(okRequest).execute()
        val response = okResponse.body?.string()?: ""
        Log.i("http request", okRequest.headers.toString())
        Log.i("http response", response)


        //val response = this.sampleResponse
        // parse json
        val gson = GsonBuilder().setLenient().create()
        val jsonElement = gson.fromJson(response, JsonElement::class.java)
        val jsonObject = gson.fromJson(jsonElement, JsonObject::class.java)
        val topTracks = jsonObject.getAsJsonObject("toptracks")
        val track = topTracks.getAsJsonArray("track")
        //select random track
        val randInt = Random.nextInt(0,limit)
        val theTrack = track[randInt]
        val artist: JsonObject = theTrack.asJsonObject.get("artist").asJsonObject

        this.trackId = theTrack.asJsonObject.get("mbid").asString
        this.trackName = theTrack.asJsonObject.get("name").asString
        this.artistName = artist.asJsonObject.get("name").asString
        this.plays = theTrack.asJsonObject.get("playcount").asNumber
        this.durationSeconds = theTrack.asJsonObject.get("duration").asInt


    }
    fun initializeClues(){
        this.clues.add("You have listened to this song " + this.plays + " times.")
        this.clues.add("This song is by " + this.artistName + ".")
        this.clues.add("This song is " + convertSecondsToTimeString(durationSeconds) + " long.")
        var hangman = this.trackName.substring(0,2)
        hangman += this.trackName.substring(2).replace(Regex("[^ ]")," _")
        hangman = hangman.replace("  ", "   ")
        this.clues.add(hangman)
    }
    fun convertSecondsToTimeString(totalSeconds: Int): String {
        val hours = totalSeconds / 3600
        val minutes = (totalSeconds % 3600) / 60
        val seconds = totalSeconds % 60

        return "%02d:%02d:%02d".format(hours, minutes, seconds)
    }
    fun checkGuess(guess: String): Boolean{
        return guess.lowercase() in this.trackName.lowercase() && guess.length > trackName.length/3
    }

